Wonder Woman v2 #82-84
Publisher:  DC Comics
Publication Date:  January - March 1994

Writer:  William Messner-Loebs
Penciller:  Shawn Atkinson (#82), Lee Moder (#83), and Nathan Massengil (#84)
Inker:  Ande Parks (#82, 84), Aaron McClellan (#82-84), Mike Manley (#82), and Carlos Garzon (#84)
Colorist:  Patricia Mulvihill
Letterer:  John Costanza
Cover Artist:  Brian Bolland

Wonder Woman #82
Wonder Woman must save Boston when an arms dealer specializing in cosmic weapons goes on a rampage. Plus, the origin of Ares Buchanan, Wonder Woman's mysterious nemesis.

Wonder Woman #83
With her powers fading, Wonder Woman must battle a super arsenal in a trap sprung by Ares Buchanan. But much worse awaits her when someone she trusts betrays her in a treacherous attack.

Wonder Woman #84
After Wonder Woman's explosive confrontation with Ares Buchanan, the lives of all involved are at stake, including those of the traitorous Donna Milton and her unborn child.

